import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Perform a search to get to results page with price filter
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'electronics');
    await page.click('.search-btn');

    // Wait for search results and price filter to appear
    await page.waitForSelector('.price-filter', { timeout: 5000 });
    await page.waitForSelector('#minPrice', { timeout: 5000 });

    // Fill price range inputs
    await page.fill('#minPrice', '50');
    await page.fill('#maxPrice', '200');

    // Click apply filter button
    await page.click('.apply-filter');

    // Wait for results to update
    await page.waitForTimeout(1000);

    // Take screenshot after applying filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_price_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_price_filter_applied.png'));

    // Extract product data to verify filter worked
    const productData = await page.evaluate(() => {
      const products = [];
      const productElements = document.querySelectorAll('.product-card, .product-card-list');

      productElements.forEach(product => {
        const priceElement = product.querySelector('.product-price');
        const priceText = priceElement ? priceElement.textContent : '';
        const priceMatch = priceText.match(/\$(\d+\.?\d*)/);
        const price = priceMatch ? parseFloat(priceMatch[1]) : 0;

        products.push({
          title: product.querySelector('.product-title')?.textContent || '',
          price: price
        });
      });

      return products;
    });

    return {
      success: true,
      action: "Applied price range filter ($50-$200) to electronics search results",
      extractedData: {
        productCount: productData.length,
        products: productData
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
